FeedPackage.Description:
Fluent registration for Spring .NET. Inspired by the Autoregistration library for Unity.
Example:
var context = new GenericApplicationContext(); context.Configure() .IncludeAssembly(x => x.FullName.StartsWith("Spring.AutoRegistration.Test")) .Include(If.ImplementsITypeName, Then.Register().WithNamedAttributeIfExists().UsingSingleton() .InjectByProperty(If.DecoratedWith<InjectAttribute>)) .ApplyAutoRegistration();
